tinymce.PluginManager.add('bootstrap3',function(editor){function openboot(){var win,dom=editor.dom;var width,height;win=editor.windowManager.open({title:'Bootstrap 3',file:'/js/editor/plugins/bootstrap3/bcomp.php?editor='+editor.id,classes:'bootstrap3',width:900,height:600,inline:1})}editor.addButton('bootstrap3',{icon:'template',tooltip:'Bootstrap 3 Component',onclick:openboot,stateSelector:'img:not([data-mce-object])'});editor.addMenuItem('bootstrap3',{icon:'template',text:'Bootstrap 3 Component',onclick:openboot,context:'insert',prependToContext:true})});
